import React from "react";
import Resources1 from "../../Assets/Resouces1.png";

const Resources = () => {
  return (
    <div className=" my-24">
      <div className="flex flex-col items-center justify-center">
        <p className=" font-semibold  text-[40px] ">Resources</p>
        <div className="flex flex-col  w-[68.75rem] mt-10 mx-20">
          <div className="flex flex-col bg-[#FFAF9A] items-center justify-center p-12">
            <div className="relative w-[22rem] h-[17rem] ">
              <img
                src={Resources1}
                alt="Resource"
                className="w-full object-fit  h-full"
              />

              <div className="absolute bottom-2 left-0 p-2 bg-[#D6E8F3] rounded-tr">
                <h2 className="text-sm font-medium">Case Studies</h2>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Resources;
